import Cookies from "universal-cookie";
const cookies = new Cookies();

export function getUserMsisdn() {
  if (cookies.get("cinemaApp")) {
    let userMsisdn = cookies.get("cinemaApp").split(",");
    return userMsisdn;
  }
  return null;
}
